import React, { useState } from "react";
import "./All.css"
import icon from "../Resimler/Süperlig_logo.png"
import { Link } from "react-router-dom";
import axios from "axios";


const Kayıtol = () => {

    const data = {name: "", email: "" };
    const [kayit, setKayitol] = useState(data)

    const handleData = (e) => {
        setKayitol({ ...Kayıtol, [e.target.name]: e.target.value })
    }

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post("https://cryptic-gorge-72989.herokuapp.com/users", kayit)
            .then(response => {
                console.log(response.data)
            })
    }

    return (
        <div>
            <div className="Profil-cercevesi">
                <div className="Profil-cerceve-ici">
                    <div className="orta">
                        <img src={icon} width="70" />
                    </div><br />
                    <div class="form-floating mb-3">
                        <input name="name" type="text" value={kayit.name} class="form-control" onChange={handleData} placeholder="Kullanıcı Adı" />
                        <label for="floatingInput">
                            <i class="fa-solid fa-user fa-beat-fade"></i> Kullanıcı Adı
                        </label>
                    </div>
                    <div class="form-floating">
                        <input name="email" type="email" value={kayit.email} class="form-control" onChange={handleData} placeholder="E-mail" />
                        <label for="floatingPassword">
                            <i class="fa-solid fa-envelope fa-beat-fade"></i> E-Mail
                        </label>
                    </div><br />
                    <Link to={"/"}><p><button onClick={handleSubmit} className="button-genisligi btn btn-light">Kayıt Ol</button></p></Link>
                </div>

            </div>
        </div>
    )
}

export default Kayıtol;
